import React from "react";
import Tabbar from "./Tabbar/Tabbar";

function App() {
  return (
    <div className="container">
      <div className="navbar-holder">
        <Tabbar />
      </div>
      <div className="home-holder">
        <h2>
          <p>Insert dp and basic info </p>
        </h2>
      </div>
      <div>
        <h3 className="info-holder">
          <p> Insert other info</p>
        </h3>
      </div>
    </div>
  );
}

export default App;
